import { github, linkedIn, gmail, fb } from '../assets/socials';
import {scrollToSection} from '../App.js'

export function Header() {
    return (
        <div className="header">
            <div className="socials">
                <a href="https://github.com/"><img src={github} alt="github" /></a>
                <a href="https://www.linkedin.com/"><img src={linkedIn} alt="linkedin" /></a>
                <a href="https://gmail.com"><img src={gmail} alt="gmail" /></a>
                <a href="https://www.facebook.com/"><img src={fb} alt="facebook" /></a>
            </div>
            <div className="nav">
                <button onClick={scrollToSection(projectsRef)}>Projects</button>
                <button onClick={scrollToSection(contactRef)}>Contact Me</button>
            </div>
        </div>
    );
}
